import styled from "styled-components";

const HeroImage = styled.img`
  height: 16em;
  width: 16em;
  object-fit: contain;
  border-radius: 50%;
`;

const AboutContainer = styled.div`
  background-color: rgba(225, 225, 225, 0.8);
  padding: 3em 2em 3em 2em;
  width: 80%;
  margin: auto;
  display: flex;
  text-align: center;
`;

const About = () => {
  return (
    <AboutContainer>
      <h1>OH HI THERE...</h1>
      <HeroImage src="/profile-photo.jpg" alt="profile-photo" />
      <p>
        Nice to meet you. I'm Hal, a personable frontend developer with 1+
        year's experience building websites and applications. I'm interested in
        development opportunities and challenging projects with passionate,
        like-minded people. Please get in touch if we seem on similar
        wavelengths!
      </p>
    </AboutContainer>
  );
};

export default About;
